import React from "react";
import Input from "../UI/Input";
import styles from "./MealItemForm.module.css";

const MealItemForm = () => {
  return (
    <form className={styles.form}>
      <Input
        label={Amount}
        input={{
          id: "amount",
          type: "number",
          min: "1",
          max: "5",
          step: "1",
          defaultvalue: "1",
        }}
      />
      <button>+ ADD</button>
    </form>
  );
};

export default MealItemForm;
